INSERT INTO `ps_inpost_shipment_status_lang` (`id_status`, `id_lang`, `title`, `description`) VALUES
(1, 1, 'Przesyłka utworzona.', 'Przesyłka została utworzona, ale nie jest gotowa do nadania.'),
(2, 1, 'Przygotowano oferty.', 'Oferty dla przesyłki zostały przygotowane.'),
(3, 1, 'Oferta wybrana.', 'Klient wybrał jedną z zaproponowanych ofert.'),
(4, 1, 'Przygotowana przez Nadawcę.', 'Nadawca poinformował nas, że przygotował przesyłkę do nadania. Podróż przesyłki jeszcze się nie rozpoczęła.'),
(5, 1, 'Paczka nadana w paczkomacie.', 'Paczka oczekuje na wyjęcie z Paczkomatu przez doręczyciela. Stąd trafi do najbliższego oddziału InPost i wyruszy w trasę do Paczkomatu odbiorczego.'),
(6, 1, 'Odebrana od klienta.', 'Kurier odebrał paczkę od Nadawcy i przekazuje ją do oddziału InPost.'),
(7, 1, 'Odebrana od Nadawcy.', 'Przesyłka została odebrana od Nadawcy i wyruszyła w dalszą drogę.'),
(8, 1, 'Przyjęta w oddziale InPost.', 'Przesyłka trafiła do oddziału InPost, skąd wkrótce wyruszy w dalszą drogę.'),
(9, 1, 'W trasie.', 'Przesyłka jest transportowana między oddziałami InPost.'),
(10, 1, 'Czeka na odbiór w PaczkoPunkcie.', 'Prosimy o odebranie przesyłki z punktu InPost w ciągu 3 dni.'),
(11, 1, 'Czeka na odbiór w PaczkoPunkcie.', 'Prosimy o odebranie przesyłki z punktu InPost w ciągu 3 dni. Adres.'),
(12, 1, 'Przesyłka ponadgabarytowa.', 'Paczka nie mieści się w skrytce Paczkomatu.'),
(13, 1, 'Przyjęta w Sortowni.', 'Przesyłka czeka na przesiadkę do miasta docelowego. W Sortowni Głównej zatrzymuje się na chwilę większość przesyłek InPost. W supernowoczesnym magazynie sortowanych jest nawet milion przesyłek dziennie!'),
(14, 1, 'Wysłana z Sortowni.', 'Przesyłka jedzie do miasta Odbiorcy.'),
(15, 1, 'Przyjęta w Oddziale Docelowym.', 'Przesyłka jest już w mieście Odbiorcy. Wkrótce trafi do rąk doręczyciela i rozpocznie ostatni etap podróży.'),
(16, 1, 'Przekazano do doręczenia.', 'Przesyłka trafi do odbiorcy najpóźniej w najbliższym dniu roboczym. Doręczyciel InPost rozwozi przesyłki nawet do późnych godzin wieczornych, dlatego warto mieć włączony telefon.'),
(17, 1, 'Umieszczona w Paczkomacie (odbiorczym).', 'I gotowe! Paczka czeka na odbiór w wybranym Paczkomacie. Odbiorca otrzymuje e-maila, a także powiadomienie w aplikacji InPost Mobile lub SMS-a z kodem odbioru i informacją, jak długo paczka będzie czekać na odbiór. Jeśli paczka nie zostanie odebrana w tym czasie, zostanie zwrócona do Nadawcy, o czym poinformujemy Odbiorcę w osobnych komunikatach.'),
(18, 1, 'Przypomnienie o czekającej paczce.', 'Paczka oczekuje w Paczkomacie. Będzie tam czekać na Ciebie przez kolejne 24 godziny. Pośpiesz się! Jeśli przesyłka nie zostanie odebrana z Paczkomatu, wróci do Nadawcy. Chcesz odpłatnie przedłużyć pobyt przesyłki w Paczkomacie? Możesz to zrobić w naszej aplikacji InPost Mobile! Dowiedz się więcej: [https://inpost.pl/pomoc-jak-przedluzyc-termin-odbioru-paczki-w-paczkomacie].'),
(19, 1, 'Dostarczona.', 'Podróż przesyłki od Nadawcy do Odbiorcy zakończyła się, ale nie musi to oznaczać końca naszej znajomości:) Jeśli lubisz InPost, odwiedź nasz fanpage na Facebooku. Dziękujemy!'),
(20, 1, 'Upłynął termin odbioru.', 'Czas na odbiór Paczki z Paczkomatu już minął. Paczka zostanie zwrócona do Nadawcy. Odbiorca  jeszcze ma szansę odebrać paczkę, jeśli dotrze do Paczkomatu przed Doręczycielem InPost.'),
(21, 1, 'Powrót do oddziału.', 'Kurier InPost ponownie nie zastał Odbiorcy pod wskazanym adresem. Przesyłka wyruszyła w drogę powrotną do Nadawcy.'),
(22, 1, 'Zareklamowana w Paczkomacie.', 'Prosimy o dokończenie procesu reklamacji poprzez wypełnienie formularza na stronie InPost.'),
(23, 1, 'Zwrot do nadawcy.', 'Przesyłka wyruszyła w drogę powrotną do Nadawcy.'),
(24, 1, 'Anulowano etykietę.', 'Etykieta nadawcza została anulowana lub utraciła ważność. Przesyłka nie została wysłana do Odbiorcy.'),
(25, 1, 'Inny status.', 'Przesyłka znajduje się w nierozpoznanym statusie.'),
(26, 1, 'Nadana w PaczkoPunkcie.', 'Nadawca przekazał przesyłkę pracownikowi punktu InPost. Tu rozpoczyna się jej podróż do Odbiorcy.'),
(27, 1, 'W doręczeniu.', 'Przesyłka jest już na ostatnim etapie podróży - została przekazana kurierowi w celu dostarczenia pod wskazany adres.'),
(28, 1, 'W doręczeniu.', 'Kurier InPost nie zastał Odbiorcy pod wskazanym adresem. Kolejna próba doręczenia nastąpi w następnym dniu roboczym.'),
(29, 1, 'Odmowa przyjęcia.', 'Odbiorca odmówił przyjęcia przesyłki.'),
(30, 1, 'Brak możliwości doręczenia.', 'Brak możliwości doręczenia w dniu dzisiejszym. Powód: błędne dane adresowe.'),
(31, 1, 'Brak możliwości doręczenia.', 'Brak możliwości doręczenia w dniu dzisiejszym. Powód: niepełne dane adresowe.'),
(32, 1, 'Brak możliwości doręczenia.', 'Brak możliwości doręczenia w dniu dzisiejszym. Powód: Odbiorca nieznany.'),
(33, 1, 'Brak możliwości doręczenia.', 'Brak możliwości doręczenia w dniu dzisiejszym - Odbiorca nie miał gotówki do opłacenia kwoty pobrania.'),
(34, 1, 'W drodze do oddziału nadawczego InPost.', 'Doręczyciel InPost odebrał przesyłkę nadaną w PaczkoPunkcie i przekazuje ją do oddziału InPost, skąd zostanie wysłana w dalszą drogę.'),
(35, 1, 'Przekazanie do magazynu przesyłek niedoręczalnych.', 'Przekazanie do magazynu przesyłek niedoręczalnych.'),
(36, 1, 'Przygotowano dokumenty zwrotne.', 'Przesyłka została odebrana. Zwrotne Potwierdzenie Odbioru zostało wysłane do Nadawcy.'),
(37, 1, 'Paczka nieodebrana – czeka w Oddziale', 'Jeśli Twoja paczka trafiła do oddziału InPost, skontaktuj się z Infolinią, aby sprawdzić możliwości jej odbioru.'),
(38, 1, 'Możliwe opóźnienie doręczenia.', 'Dostawa się opóźni - najmocniej przepraszamy. W kolejnych wiadomościach poinformujemy Odbiorcę o nowym terminie doręczenia.'),
(39, 1, 'Przekierowano do Paczkomatu.', 'Adresat tej paczki kurierskiej skorzystał z darmowej opcji dynamicznego przekierowania do Paczkomatu InPost. Po dostarczeniu przesyłki do wybranej maszyny odbiorca otrzyma wiadomości, dzięki którym, będzie mógł ją odebrać.'),
(40, 1, 'Anulowano przekierowanie.', 'Przekierowanie tej paczki kurierskiej do Paczkomatu InPost okazało się niemożliwe ze względu na zbyt duży gabaryt. Przesyłka zostanie doręczona do Odbiorcy na adres wskazany w zamówieniu.'),
(41, 1, 'Przekierowano na inny adres.', 'Przesyłka kurierska została bezpłatnie przekierowana na inny adres na życzenie Odbiorcy.'),
(42, 1, 'Brak możliwości doręczenia.', 'Brak możliwości doręczenia w dniu dzisiejszym. Powód: brak skrzynki pocztowej.'),
(43, 1, 'Brak możliwości doręczenia.', 'Brak możliwości doręczenia w dniu dzisiejszym. Powód: Odbiorca nie mieszka pod wskazanym adresem.'),
(44, 1, 'Brak możliwości doręczenia.', 'Paczka wyruszyła w drogę powrotną do Nadawcy.'),
(45, 1, 'translation missing: pl_PL.statuses.missing.title', 'translation missing: pl_PL.statuses.missing.description'),
(46, 1, 'Paczka magazynowana w PaczkoPunkcie.', 'Kliknij i dowiedz się więcej na temat magazynowania paczek w  PaczkoPunkcie. https://inpost.pl/pomoc-czym-jest-magazynowanie-paczek-w-pop'),
(47, 1, 'Upłynął termin odbioru paczki magazynowanej.', 'Upłynął termin odebrania paczki z PaczkoPunktu, ale paczka nadal jest w nim magazynowana - czeka na przyjazd kuriera, który ją zabierze do paczkomatu.'),
(48, 1, 'W drodze do wybranego paczkomatu.', 'Kurier wiezie Twoją paczkę do paczkomatu.'),
(49, 1, 'Oczekuje na odbiór.', 'Paczka została awizowana w PaczkoPunkcie. Jeśli jej nie odbierzesz w ciągu trzech dni roboczych, wróci do Nadawcy.'),
(50, 1, 'Zwrócona do nadawcy.', 'Czas na odbiór paczki minął. Została odebrana przez Kuriera z PaczkoPunktu i niebawem wyruszy w podróż powrotną do Nadawcy.'),
(51, 1, 'Paczka magazynowana w Paczkomacie tymczasowym', 'Kliknij i dowiedz się więcej na temat magazynowania paczek w Paczkomatach tymczasowych: https://inpost.pl/pomoc-czym-jest-magazynowanie-paczek-w-paczkomatach-tymczasowych'),
(52, 1, 'Paczka w drodze do pierwotnie wybranego Paczkomatu', 'Czas na odbiór paczki magazynowanej w Paczkomacie tymczasowym upłynął. Paczka jest w drodze do pierwotnie wybranego Paczkomatu. Poinformujemy Cię, gdy będzie na miejscu.'),
(53, 1, 'Upłynął termin odbioru paczki magazynowanej', 'Upłynął termin odebrania paczki z Paczkomatu tymczasowego, ale paczka nadal jest w nim magazynowana - czeka na przyjazd kuriera, który ją zabierze do pierwotnie wybranego Paczkomatu.');
